ax, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1432700","type":"CustomJS"},{"attributes":{"factors":["0","1"],"palette":["tomato","lime"]},"id":"1432384","type":"CategoricalColorMapper"},{"attributes":{"coordinates":null,"data_source":{"id":"1432483"},"glyph":{"id":"1432484"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1432486"},"nonselection_glyph":{"id":"1432485"},"view":{"id":"1432488"}},"id":"1432487","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"data_source":{"id":"1432438"},"glyph":{"id":"1432439"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1432441"},"nonselection_glyph":{"id":"1432440"},"view":{"id":"1432443"}},"id":"1432442","type":"GlyphRenderer"},{"attributes":{},"id":"1432544","type":"BasicTicker"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.2},"fill_color":{"field":"inc","transform":{"id":"1432636
